        //     ))}
        // </div>

        <div id="chefs-cards-container">
            {chefsData.map((chef:IChefCard)=>( <ChefCard 
            name={chef.name}
            img= {chef.img}/>
            ))}
        </div>  
    );
}

export default ChefsCards;
